INSERT INTO `s_custom_reports` VALUES (1,-1,'Բալեր','select  f_saler as `Վաճառող`, sum(f_amount) as `Վաճառք`, sum(f_score) as `Բալ`\n from (\n select o.f_datecash , h.f_name as f_store, concat(u.f_last, \' \', u.f_first) as f_saler , sum(o.f_amounttotal) as f_amount, (((floor(sum(o.f_amounttotal)/10000)*10)-100)/100) + 3.5 as f_score  \n from o_header o \n left join s_user u on u.f_id=o.f_staff \n left join h_halls h on h.f_id=o.f_hall\n where o.f_amounttotal>0 and o.f_state=2 and o.f_datecash between %date1;Սկիզբ:date% and %date2;Ավարտ:date% %and o.f_hall in (~list);Խանութ:cache22%\n group by 1,2,3\n having sum(o.f_amounttotal)>99999\n ) as sales group by 1',NULL),(2,-1,'Дроздоперда','select gr.f_name as `Խումբ`, g.f_name as `Ապրանք`, g.f_scancode as `Շտրիխկոդ`,\n og.f_qty as `Քնկ`, og.f_price as `Գին`, og.f_total as `Գումար`, ah2.f_comment as `Մուտքի մետկնաբանություն`\nfrom o_goods og\ninner join o_header oh on oh.f_id=og.f_header\ninner join c_goods g on g.f_id=og.f_goods\ninner join c_groups gr on gr.f_id=g.f_group \ninner join o_header oh on oh.f_id=og.f_header\ninner join a_store_draft ad on ad.f_id=og.f_storerec\ninner join a_store ast on ast.f_draft=ad.f_id\ninner join a_store astb on astb.f_id=ast.f_base\ninner join a_header ah on ah.f_id=ad.f_document\ninner join a_header ah2 on ah2.f_id=astb.f_document\nwhere oh.f_hall=10 and ah2.f_comment not like \'%AUTOMAT%\' \nand oh.f_datecash between %date1;Սկիզբ:date% and %date2;Ավարտ:date%',NULL);
/*!40000 ALTER TABLE `s_custom_reports` ENABLE KEYS */;
UNLOCK TABLES;

